func GR() {
    var wg sync.WaitGroup
    wg.Add(10)
    for i := 0; i < 10; i++ {
        go func(id int) {
            time.Sleep(time.Second)
            fmt.Printf("g%v\n", id)
            wg.Done()
        }(i)
    }
    wg.Wait()
}
